# #     # 最后一行补位
# #     if len(rows[-1]) < bits_per_row:
# #         rows[-1] += '1' * (bits_per_row - len(rows[-1]))
# #
# #     # 创建图像
# #     img_width = bits_per_row * cell_size
# #     img_height = len(rows) * cell_size
# #     img = Image.new("RGB", (img_width, img_height), "white")
# #     draw = ImageDraw.Draw(img)
# #
