# #             fill_color = "black" if bit == "0" else "white"
# #             # 将边框改为蓝色（outline="blue"）
# #             draw.rectangle([x1, y1, x2, y2], fill=fill_color, outline="blue")  # [8](@ref)
# #
# #     # 放大图像
# #     if scale > 1:
# #         img = img.resize((img_width * scale, img_height * scale), Image.NEAREST)
# #
# #     img.save(output_path)
# #     return output_path
